```
# use bevy_math::{Rect, Vec2};
let r = Rect::new(0., 0., 5., 1.); // w=5 h=1
let r2 = r.inflate(3.); // w=11 h=7
assert!(r2.min.abs_diff_eq(Vec2::splat(-3.), 1e-5));
assert!(r2.max.abs_diff_eq(Vec2::new(8., 4.), 1e-5));
let r = Rect::new(0., -1., 6., 7.); // w=6 h=8
let r2 = r.inflate(-2.); // w=11 h=7
assert!(r2.min.abs_diff_eq(Vec2::new(2., 1.), 1e-5));
assert!(r2.max.abs_diff_eq(Vec2::new(4., 5.), 1e-5));
```

bevy_math::rects::rect::Rect::intersect.documentation:
Build a new rectangle formed of the intersection of this rectangle and another rectangle.
The intersection is the largest rectangle enclosed in both rectangles. If the intersection
is empty, this method returns an empty rectangle ([`Rect::is_empty()`] returns `true`), but
the actual values of [`Rect::min`] and [`Rect::max`] are implementation-dependent.
# Examples
```
# use bevy_math::{Rect, Vec2};
let r1 = Rect::new(0., 0., 5., 1.); // w=5 h=1
let r2 = Rect::new(1., -1., 3., 3.); // w=2 h=4
let r = r1.intersect(r2);
assert!(r.min.abs_diff_eq(Vec2::new(1., 0.), 1e-5));
assert!(r.max.abs_diff_eq(Vec2::new(3., 1.), 1e-5));
```

bevy_math::rects::rect::Rect::normalize.documentation:
Build a new rectangle from this one with its coordinates expressed
relative to `other` in a normalized ([0..1] x [0..1]) coordinate system.
# Examples
```
# use bevy_math::{Rect, Vec2};
let r = Rect::new(2., 3., 4., 6.);
let s = Rect::new(0., 0., 10., 10.);
let n = r.normalize(s);
assert_eq!(n.min.x, 0.2);
assert_eq!(n.min.y, 0.3);
assert_eq!(n.max.x, 0.4);
assert_eq!(n.max.y, 0.6);
```

bevy_math::rects::rect::Rect::union.documentation:
Build a new rectangle formed of the union of this rectangle and another rectangle.
The union is the smallest rectangle enclosing both rectangles.
# Examples
```
# use bevy_math::{Rect, Vec2};
let r1 = Rect::new(0., 0., 5., 1.); // w=5 h=1
let r2 = Rect::new(1., -1., 3., 3.); // w=2 h=4
let r = r1.union(r2);
assert!(r.min.abs_diff_eq(Vec2::new(0., -1.), 1e-5));
assert!(r.max.abs_diff_eq(Vec2::new(5., 3.), 1e-5));
```

bevy_math::rects::rect::Rect::union_poin.documentation:
Build a new rectangle formed of the union of this rectangle and a point.
The union is the smallest rectangle enclosing both the rectangle and the point. If the
point is already inside the rectangle, this method returns a copy of the rectangle.
# Examples
```
# use bevy_math::{Rect, Vec2};
let r = Rect::new(0., 0., 5., 1.); // w=5 h=1
let u = r.union_point(Vec2::new(3., 6.));
assert!(u.min.abs_diff_eq(Vec2::ZERO, 1e-5));
assert!(u.max.abs_diff_eq(Vec2::new(5., 6.), 1e-5));
```

bevy_math::rects::urect::URect::contains.documentation:
Check if a point lies within this rectangle, inclusive of its edges.
# Examples
```
# use bevy_math::URect;
let r = URect::new(0, 0, 5, 1); // w=5 h=1
assert!(r.contains(r.center()));
assert!(r.contains(r.min));
assert!(r.contains(r.max));
```

bevy_math::rects::urect::URect::from_cen.documentation:
Create a new rectangle from its center and half-size.
# Panics
This method panics if any of the components of the half-size is negative or if `origin - half_size` results in any negatives.
# Examples
```
# use bevy_math::{URect, UVec2};
let r = URect::from_center_half_size(UVec2::ONE, UVec2::ONE); // w=2 h=2
assert_eq!(r.min, UVec2::splat(0));
assert_eq!(r.max, UVec2::splat(2));
```

bevy_math::rects::urect::URect::inflate.documentation:
Create a new rectangle by expanding it evenly on all sides.
A positive expansion value produces a larger rectangle,
while a negative expansion value produces a smaller rectangle.
If this would result in zero width or height, [`URect::EMPTY`] is returned instead.
# Examples
```
# use bevy_math::{URect, UVec2};
let r = URect::new(4, 4, 6, 6); // w=2 h=2
let r2 = r.inflate(1); // w=4 h=4
assert_eq!(r2.min, UVec2::splat(3));
assert_eq!(r2.max, UVec2::splat(7));
let r = URect::new(4, 4, 8, 8); // w=4 h=4
let r2 = r.inflate(-1); // w=2 h=2
assert_eq!(r2.min, UVec2::splat(5));
assert_eq!(r2.max, UVec2::splat(7));
```

bevy_math::rects::urect::URect::intersec.documentation:
Build a new rectangle formed of the intersection of this rectangle and another rectangle.
The intersection is the largest rectangle enclosed in both rectangles. If the intersection
is empty, this method returns an empty rectangle ([`URect::is_empty()`] returns `true`), but
the actual values of [`URect::min`] and [`URect::max`] are implementation-dependent.
# Examples
```
# use bevy_math::{URect, UVec2};
let r1 = URect::new(0, 0, 2, 2); // w=2 h=2
let r2 = URect::new(1, 1, 3, 3); // w=2 h=2
let r = r1.intersect(r2);
assert_eq!(r.min, UVec2::new(1, 1));
assert_eq!(r.max, UVec2::new(2, 2));
```

bevy_math::rects::urect::URect::union.documentation:
Build a new rectangle formed of the union of this rectangle and another rectangle.
The union is the smallest rectangle enclosing both rectangles.
# Examples
```
# use bevy_math::{URect, UVec2};
let r1 = URect::new(0, 0, 5, 1); // w=5 h=1
let r2 = URect::new(1, 0, 3, 8); // w=2 h=4
let r = r1.union(r2);
assert_eq!(r.min, UVec2::new(0, 0));
assert_eq!(r.max, UVec2::new(5, 8));
```

bevy_math::rects::urect::URect::union_po.documentation:
Build a new rectangle formed of the union of this rectangle and a point.
The union is the smallest rectangle enclosing both the rectangle and the point. If the
point is already inside the rectangle, this method returns a copy of the rectangle.
# Examples
```
# use bevy_math::{URect, UVec2};
let r = URect::new(0, 0, 5, 1); // w=5 h=1
let u = r.union_point(UVec2::new(3, 6));
assert_eq!(u.min, UVec2::ZERO);
assert_eq!(u.max, UVec2::new(5, 6));
```

bevy_math::rotation2d::Rot2::degrees.documentation:
Creates a [`Rot2`] from a counterclockwise angle in degrees.
# Note
The input rotation will always be clamped to the range `(-180, 180]` by design.
# Example
```
# use bevy_math::Rot2;
# use approx::assert_relative_eq;
let rot1 = Rot2::degrees(270.0);
let rot2 = Rot2::degrees(-90.0);
assert_relative_eq!(rot1, rot2);
let rot3 = Rot2::degrees(180.0);
assert_relative_eq!(rot1 * rot1, rot3);
```

bevy_math::rotation2d::Rot2::radians.documentation:
Creates a [`Rot2`] from a counterclockwise angle in radians.
# Note
The input rotation will always be clamped to the range `(-, ]` by design.
# Example
```
# use bevy_math::Rot2;
# use approx::assert_relative_eq;
# use std::f32::consts::{FRAC_PI_2, PI};
let rot1 = Rot2::radians(3.0 * FRAC_PI_2);
let rot2 = Rot2::radians(-FRAC_PI_2);
assert_relative_eq!(rot1, rot2);
let rot3 = Rot2::radians(PI);
assert_relative_eq!(rot1 * rot1, rot3);
```

bevy_math::rotation2d::Rot2::slerp.documentation:
Performs a spherical linear interpolation between `self` and `end`
based on the value `s`.
This corresponds to interpolating between the two angles at a constant angular velocity.
When `s == 0.0`, the result will be equal to `self`.
When `s == 1.0`, the result will be equal to `rhs`.
If you would like the rotation to have a kind of ease-in-out effect, consider
using the slightly more efficient [`nlerp`](Self::nlerp) instead.
# Example
```
# use bevy_math::Rot2;
#
let rot1 = Rot2::IDENTITY;
let rot2 = Rot2::degrees(135.0);
let result1 = rot1.slerp(rot2, 1.0 / 3.0);
assert_eq!(result1.as_degrees(), 45.0);
let result2 = rot1.slerp(rot2, 0.5);
assert_eq!(result2.as_degrees(), 67.5);
```

bevy_math::rotation2d::Rot2::turn_fracti.documentation:
Creates a [`Rot2`] from a counterclockwise fraction of a full turn of 360 degrees.
# Note
The input rotation will always be clamped to the range `(-50%, 50%]` by design.
# Example
```
# use bevy_math::Rot2;
# use approx::assert_relative_eq;
let rot1 = Rot2::turn_fraction(0.75);
let rot2 = Rot2::turn_fraction(-0.25);
assert_relative_eq!(rot1, rot2);
let rot3 = Rot2::turn_fraction(0.5);
assert_relative_eq!(rot1 * rot1, rot3);
```

bevy_time::stopwatch::Stopwatch::elapsed.documentation:
Returns the elapsed time since the last [`reset`](Stopwatch::reset)
of the stopwatch.
# Examples
```
# use bevy_time::*;
use std::time::Duration;
let mut stopwatch = Stopwatch::new();
stopwatch.tick(Duration::from_secs(1));
assert_eq!(stopwatch.elapsed(), Duration::from_secs(1));
```
# See Also
[`elapsed_secs`](Stopwatch::elapsed_secs) - if an `f32` value is desirable instead.
[`elapsed_secs_f64`](Stopwatch::elapsed_secs_f64) - if an `f64` is desirable instead.

Returns the elapsed time since the last [`reset`](Stopwatch::reset)
of the stopwatch, in seconds.
# Examples
```
# use bevy_time::*;
use std::time::Duration;
let mut stopwatch = Stopwatch::new();
stopwatch.tick(Duration::from_secs(1));
assert_eq!(stopwatch.elapsed_secs(), 1.0);
```
# See Also
[`elapsed`](Stopwatch::elapsed) - if a `Duration` is desirable instead.
[`elapsed_secs_f64`](Stopwatch::elapsed_secs_f64) - if an `f64` is desirable instead.

bevy_time::stopwatch::Stopwatch::is_paus.documentation:
Returns `true` if the stopwatch is paused.
# Examples
```
# use bevy_time::*;
let mut stopwatch = Stopwatch::new();
assert!(!stopwatch.is_paused());
stopwatch.pause();
assert!(stopwatch.is_paused());
stopwatch.unpause();
assert!(!stopwatch.is_paused());
```

bevy_time::stopwatch::Stopwatch::new.documentation:
Create a new unpaused `Stopwatch` with no elapsed time.
# Examples
```
# use bevy_time::*;
let stopwatch = Stopwatch::new();
assert_eq!(stopwatch.elapsed_secs(), 0.0);
assert_eq!(stopwatch.is_paused(), false);
```

bevy_time::stopwatch::Stopwatch::pause.documentation:
Pauses the stopwatch. Any call to [`tick`](Stopwatch::tick) while
paused will not have any effect on the elapsed time.
# Examples
```
# use bevy_time::*;
use std::time::Duration;
let mut stopwatch = Stopwatch::new();
stopwatch.pause();
stopwatch.tick(Duration::from_secs_f32(1.5));
assert!(stopwatch.is_paused());
assert_eq!(stopwatch.elapsed_secs(), 0.0);
```

bevy_time::stopwatch::Stopwatch::reset.documentation:
Resets the stopwatch. The reset doesn't affect the paused state of the stopwatch.
# Examples
```
# use bevy_time::*;
use std::time::Duration;
let mut stopwatch = Stopwatch::new();
stopwatch.tick(Duration::from_secs_f32(1.5));
stopwatch.reset();
assert_eq!(stopwatch.elapsed_secs(), 0.0);
```

bevy_time::stopwatch::Stopwatch::set_ela.documentation:
Sets the elapsed time of the stopwatch.
# Examples
```
# use bevy_time::*;
use std::time::Duration;
let mut stopwatch = Stopwatch::new();
stopwatch.set_elapsed(Duration::from_secs_f32(1.0));
assert_eq!(stopwatch.elapsed_secs(), 1.0);
```

bevy_time::stopwatch::Stopwatch::unpause.documentation:
Unpauses the stopwatch. Resume the effect of ticking on elapsed time.
# Examples
```
# use bevy_time::*;
use std::time::Duration;
let mut stopwatch = Stopwatch::new();
stopwatch.pause();
stopwatch.tick(Duration::from_secs_f32(1.0));
stopwatch.unpause();
stopwatch.tick(Duration::from_secs_f32(1.0));
assert!(!stopwatch.is_paused());
assert_eq!(stopwatch.elapsed_secs(), 1.0);
```

bevy_time::timer::Timer::duration.documentation:
Returns the duration of the timer.
# Examples
```
# use bevy_time::*;
use std::time::Duration;
let timer = Timer::new(Duration::from_secs(1), TimerMode::Once);
assert_eq!(timer.duration(), Duration::from_secs(1));
```

bevy_time::timer::Timer::elapsed.documentation:
Returns the time elapsed on the timer. Guaranteed to be between 0.0 and `duration`.
Will only equal `duration` when the timer is finished and non repeating.
See also [`Stopwatch::elapsed`](Stopwatch::elapsed).
# Examples
```
# use bevy_time::*;
use std::time::Duration;
let mut timer = Timer::from_seconds(1.0, TimerMode::Once);
timer.tick(Duration::from_secs_f32(0.5));
assert_eq!(timer.elapsed(), Duration::from_secs_f32(0.5));
```

bevy_time::timer::Timer::finished.documentation:
Returns `true` if the timer has reached its duration.
For repeating timers, this method behaves identically to [`Timer::just_finished`].
# Examples
```
# use bevy_time::*;
use std::time::Duration;
let mut timer_once = Timer::from_seconds(1.0, TimerMode::Once);
timer_once.tick(Duration::from_secs_f32(1.5));
assert!(timer_once.finished());
timer_once.tick(Duration::from_secs_f32(0.5));
assert!(timer_once.finished());
let mut timer_repeating = Timer::from_seconds(1.0, TimerMode::Repeating);
timer_repeating.tick(Duration::from_secs_f32(1.1));
assert!(timer_repeating.finished());
timer_repeating.tick(Duration::from_secs_f32(0.8));
assert!(!timer_repeating.finished());
timer_repeating.tick(Duration::from_secs_f32(0.6));
assert!(timer_repeating.finished());
```

bevy_time::timer::Timer::fraction.documentation:
Returns the fraction of the timer elapsed time (goes from 0.0 to 1.0).
# Examples
```
# use bevy_time::*;
use std::time::Duration;
let mut timer = Timer::from_seconds(2.0, TimerMode::Once);
timer.tick(Duration::from_secs_f32(0.5));
assert_eq!(timer.fraction(), 0.25);
```

bevy_time::timer::Timer::fraction_remain.documentation:
Returns the fraction of the timer remaining time (goes from 1.0 to 0.0).
# Examples
```
# use bevy_time::*;
use std::time::Duration;
let mut timer = Timer::from_seconds(2.0, TimerMode::Once);
timer.tick(Duration::from_secs_f32(0.5));
assert_eq!(timer.fraction_remaining(), 0.75);
```

bevy_time::timer::Timer::from_seconds.documentation:
Creates a new timer with a given duration in seconds.
# Example
```
# use bevy_time::*;
let mut timer = Timer::from_seconds(1.0, TimerMode::Once);
```

bevy_time::timer::Timer::just_finished.documentation:
Returns `true` only on the tick the timer reached its duration.
# Examples
```
# use bevy_time::*;
use std::time::Duration;
let mut timer = Timer::from_seconds(1.0, TimerMode::Once);
timer.tick(Duration::from_secs_f32(1.5));
assert!(timer.just_finished());
timer.tick(Duration::from_secs_f32(0.5));
assert!(!timer.just_finished());
```

bevy_time::timer::Timer::mode.documentation:
Returns the mode of the timer.
# Examples
```
# use bevy_time::*;
let mut timer = Timer::from_seconds(1.0, TimerMode::Repeating);
assert_eq!(timer.mode(), TimerMode::Repeating);
```

bevy_time::timer::Timer::pause.documentation:
Pauses the Timer. Disables the ticking of the timer.
See also [`Stopwatch::pause`](Stopwatch::pause).
# Examples
```
# use bevy_time::*;
use std::time::Duration;
let mut timer = Timer::from_seconds(1.0, TimerMode::Once);
timer.pause();
timer.tick(Duration::from_secs_f32(0.5));
assert_eq!(timer.elapsed_secs(), 0.0);
```

bevy_time::timer::Timer::paused.documentation:
Returns `true` if the timer is paused.
See also [`Stopwatch::is_paused`](Stopwatch::is_paused).
# Examples
```
# use bevy_time::*;
let mut timer = Timer::from_seconds(1.0, TimerMode::Once);
assert!(!timer.paused());
timer.pause();
assert!(timer.paused());
timer.unpause();
assert!(!timer.paused());
```

bevy_time::timer::Timer::remaining.documentation:
Returns the remaining time using Duration
# Examples
```
# use bevy_time::*;
use std::time::Duration;
let mut timer = Timer::from_seconds(2.0, TimerMode::Once);
timer.tick(Duration::from_secs_f32(0.5));
assert_eq!(timer.remaining(), Duration::from_secs_f32(1.5));
```

bevy_time::timer::Timer::remaining_secs.documentation:
Returns the remaining time in seconds
# Examples
```
# use bevy_time::*;
use std::cmp::Ordering;
use std::time::Duration;
let mut timer = Timer::from_seconds(2.0, TimerMode::Once);
timer.tick(Duration::from_secs_f32(0.5));
let result = timer.remaining_secs().total_cmp(&1.5);
assert_eq!(Ordering::Equal, result);
```

bevy_time::timer::Timer::reset.documentation:
Resets the timer. The reset doesn't affect the `paused` state of the timer.
See also [`Stopwatch::reset`](Stopwatch::reset).
Examples
```
# use bevy_time::*;
use std::time::Duration;
let mut timer = Timer::from_seconds(1.0, TimerMode::Once);
timer.tick(Duration::from_secs_f32(1.5));
timer.reset();
assert!(!timer.finished());
assert!(!timer.just_finished());
assert_eq!(timer.elapsed_secs(), 0.0);
```

bevy_time::timer::Timer::set_duration.documentation:
Sets the duration of the timer.
# Examples
```
# use bevy_time::*;
use std::time::Duration;
let mut timer = Timer::from_seconds(1.5, TimerMode::Once);
timer.set_duration(Duration::from_secs(1));
assert_eq!(timer.duration(), Duration::from_secs(1));
```

bevy_time::timer::Timer::set_elapsed.documentation:
Sets the elapsed time of the timer without any other considerations.
See also [`Stopwatch::set`](Stopwatch::set).
#
```
# use bevy_time::*;
use std::time::Duration;
let mut timer = Timer::from_seconds(1.0, TimerMode::Once);
timer.set_elapsed(Duration::from_secs(2));
assert_eq!(timer.elapsed(), Duration::from_secs(2));
// the timer is not finished even if the elapsed time is greater than the duration.
assert!(!timer.finished());
```

bevy_time::timer::Timer::set_mode.documentation:
Sets the mode of the timer.
# Examples
```
# use bevy_time::*;
let mut timer = Timer::from_seconds(1.0, TimerMode::Repeating);
timer.set_mode(TimerMode::Once);
assert_eq!(timer.mode(), TimerMode::Once);
```

bevy_time::timer::Timer::times_finished_.documentation:
Returns the number of times a repeating timer
finished during the last [`tick`](Timer<T>::tick) call.
For non repeating-timers, this method will only ever
return 0 or 1.
# Examples
```
# use bevy_time::*;
use std::time::Duration;
let mut timer = Timer::from_seconds(1.0, TimerMode::Repeating);
timer.tick(Duration::from_secs_f32(6.0));
assert_eq!(timer.times_finished_this_tick(), 6);
timer.tick(Duration::from_secs_f32(2.0));
assert_eq!(timer.times_finished_this_tick(), 2);
timer.tick(Duration::from_secs_f32(0.5));
assert_eq!(timer.times_finished_this_tick(), 0);
```

bevy_time::timer::Timer::unpause.documentation:
Unpauses the Timer. Resumes the ticking of the timer.
See also [`Stopwatch::unpause()`](Stopwatch::unpause).
# Examples
```
# use bevy_time::*;
use std::time::Duration;
let mut timer = Timer::from_seconds(1.0, TimerMode::Once);
timer.pause();
timer.tick(Duration::from_secs_f32(0.5));
timer.unpause();
timer.tick(Duration::from_secs_f32(0.5));
assert_eq!(timer.elapsed_secs(), 0.5);
```

bevy_transform::components::global_trans.documentation:
Returns the [`Transform`] `self` would have if it was a child of an entity
with the `parent` [`GlobalTransform`].
This is useful if you want to "reparent" an [`Entity`](bevy_ecs::entity::Entity).
Say you have an entity `e1` that you want to turn into a child of `e2`,
but you want `e1` to keep the same global transform, even after re-parenting. You would use:
```
# use bevy_transform::prelude::{GlobalTransform, Transform};
# use bevy_ecs::prelude::{Entity, Query, Component, Commands};
# use bevy_hierarchy::{prelude::Parent, BuildChildren};
#[derive(Component)]
struct ToReparent {
    new_parent: Entity,
}
fn reparent_system(
    mut commands: Commands,
    mut targets: Query<(&mut Transform, Entity, &GlobalTransform, &ToReparent)>,
    transforms: Query<&GlobalTransform>,
) {
    for (mut transform, entity, initial, to_reparent) in targets.iter_mut() {
        if let Ok(parent_transform) = transforms.get(to_reparent.new_parent) {
            *transform = initial.reparented_to(parent_transform);
            commands.entity(entity)
                .remove::<ToReparent>()
                .set_parent(to_reparent.new_parent);
        }
    }
}
```
The transform is expected to be non-degenerate and without shearing, or the output
will be invalid.

Transforms the given point from local space to global space, applying shear, scale, rotation and translation.
It can be used like this:
```
# use bevy_transform::prelude::{GlobalTransform};
# use bevy_math::prelude::Vec3;
let global_transform = GlobalTransform::from_xyz(1., 2., 3.);
let local_point = Vec3::new(1., 2., 3.);
let global_point = global_transform.transform_point(local_point);
assert_eq!(global_point, Vec3::new(2., 4., 6.));
```
```
# use bevy_transform::prelude::{GlobalTransform};
# use bevy_math::Vec3;
let global_point = Vec3::new(2., 4., 6.);
let global_transform = GlobalTransform::from_xyz(1., 2., 3.);
let local_point = global_transform.affine().inverse().transform_point3(global_point);
assert_eq!(local_point, Vec3::new(1., 2., 3.))
```
To apply shear, scale, and rotation *without* applying translation, different functions are available:
```
# use bevy_transform::prelude::{GlobalTransform};
# use bevy_math::prelude::Vec3;
let global_transform = GlobalTransform::from_xyz(1., 2., 3.);
let local_direction = Vec3::new(1., 2., 3.);
let global_direction = global_transform.affine().transform_vector3(local_direction);
assert_eq!(global_direction, Vec3::new(1., 2., 3.));
let roundtripped_local_direction = global_transform.affine().inverse().transform_vector3(global_direction);
assert_eq!(roundtripped_local_direction, local_direction);
```

bevy_utils::Duration::abs_diff.documentation:
