bevy_utils::Duration::as_millis.documentation:
Returns the total number of whole milliseconds contained by this `Duration`.
# Examples
```
use std::time::Duration;
let duration = Duration::new(5, 730_023_852);
assert_eq!(duration.as_millis(), 5_730);
```

bevy_utils::Duration::as_nanos.documentation:
Returns the total number of nanoseconds contained by this `Duration`.
# Examples
```
use std::time::Duration;
let duration = Duration::new(5, 730_023_852);
assert_eq!(duration.as_nanos(), 5_730_023_852);
```

bevy_utils::Duration::as_secs_f32.documentation:
Returns the number of seconds contained by this `Duration` as `f32`.
The returned value includes the fractional (nanosecond) part of the duration.
# Examples
```
use std::time::Duration;
let dur = Duration::new(2, 700_000_000);
assert_eq!(dur.as_secs_f32(), 2.7);
```

bevy_utils::Duration::as_secs_f64.documentation:
