bevy_utils::Duration::from_micros.documentation:
Creates a new `Duration` from the specified number of microseconds.
# Examples
```
use std::time::Duration;
let duration = Duration::from_micros(1_000_002);
assert_eq!(1, duration.as_secs());
assert_eq!(2_000, duration.subsec_nanos());
```

bevy_utils::Duration::from_millis.documentation:
Creates a new `Duration` from the specified number of milliseconds.
# Examples
```
use std::time::Duration;
let duration = Duration::from_millis(2_569);
assert_eq!(2, duration.as_secs());
assert_eq!(569_000_000, duration.subsec_nanos());
```

bevy_utils::Duration::from_nanos.documentation:
Creates a new `Duration` from the specified number of nanoseconds.
Note: Using this on the return value of `as_nanos()` might cause unexpected behavior:
`as_nanos()` returns a u128, and can return values that do not fit in u64, e.g. 585 years.
Instead, consider using the pattern `Duration::new(d.as_secs(), d.subsec_nanos())`
if you cannot copy/clone the Duration directly.
# Examples
```
use std::time::Duration;
let duration = Duration::from_nanos(1_000_000_123);
assert_eq!(1, duration.as_secs());
assert_eq!(123, duration.subsec_nanos());
```

bevy_utils::Duration::from_secs.documentation:
Creates a new `Duration` from the specified number of whole seconds.
# Examples
```
use std::time::Duration;
let duration = Duration::from_secs(5);
assert_eq!(5, duration.as_secs());
assert_eq!(0, duration.subsec_nanos());
```

bevy_utils::Duration::from_secs_f32.documentation:
Creates a new `Duration` from the specified number of seconds represented
as `f32`.
# Panics
This constructor will panic if `secs` is negative, overflows `Duration` or not finite.
# Examples
```
use std::time::Duration;
let res = Duration::from_secs_f32(0.0);
assert_eq!(res, Duration::new(0, 0));
let res = Duration::from_secs_f32(1e-20);
assert_eq!(res, Duration::new(0, 0));
let res = Duration::from_secs_f32(4.2e-7);
assert_eq!(res, Duration::new(0, 420));
let res = Duration::from_secs_f32(2.7);
assert_eq!(res, Duration::new(2, 700_000_048));
let res = Duration::from_secs_f32(3e10);
assert_eq!(res, Duration::new(30_000_001_024, 0));
// subnormal float
let res = Duration::from_secs_f32(f32::from_bits(1));
assert_eq!(res, Duration::new(0, 0));
// conversion uses rounding
let res = Duration::from_secs_f32(0.999e-9);
assert_eq!(res, Duration::new(0, 1));
```

bevy_utils::Duration::from_secs_f64.documentation:
Creates a new `Duration` from the specified number of seconds represented
as `f64`.
# Panics
This constructor will panic if `secs` is negative, overflows `Duration` or not finite.
# Examples
```
use std::time::Duration;
let res = Duration::from_secs_f64(0.0);
assert_eq!(res, Duration::new(0, 0));
let res = Duration::from_secs_f64(1e-20);
assert_eq!(res, Duration::new(0, 0));
let res = Duration::from_secs_f64(4.2e-7);
assert_eq!(res, Duration::new(0, 420));
let res = Duration::from_secs_f64(2.7);
assert_eq!(res, Duration::new(2, 700_000_000));
let res = Duration::from_secs_f64(3e10);
assert_eq!(res, Duration::new(30_000_000_000, 0));
// subnormal float
let res = Duration::from_secs_f64(f64::from_bits(1));
assert_eq!(res, Duration::new(0, 0));
// conversion uses rounding
let res = Duration::from_secs_f64(0.999e-9);
assert_eq!(res, Duration::new(0, 1));
```

bevy_utils::Duration::is_zero.documentation:
Returns true if this `Duration` spans no time.
# Examples
```
use std::time::Duration;
assert!(Duration::ZERO.is_zero());
assert!(Duration::new(0, 0).is_zero());
assert!(Duration::from_nanos(0).is_zero());
assert!(Duration::from_secs(0).is_zero());
assert!(!Duration::new(1, 1).is_zero());
assert!(!Duration::from_nanos(1).is_zero());
assert!(!Duration::from_secs(1).is_zero());
```

bevy_utils::Duration::mul_f32.documentation:
