bevy_utils::Duration::saturating_add.documentation:
Saturating `Duration` addition. Computes `self + other`, returning [`Duration::MAX`]
if overflow occurred.
# Examples
```
#![feature(duration_constants)]
use std::time::Duration;
assert_eq!(Duration::new(0, 0).saturating_add(Duration::new(0, 1)), Duration::new(0, 1));
assert_eq!(Duration::new(1, 0).saturating_add(Duration::new(u64::MAX, 0)), Duration::MAX);
```

bevy_utils::Duration::saturating_mul.documentation:
Saturating `Duration` multiplication. Computes `self * other`, returning
[`Duration::MAX`] if overflow occurred.
# Examples
```
#![feature(duration_constants)]
use std::time::Duration;
assert_eq!(Duration::new(0, 500_000_001).saturating_mul(2), Duration::new(1, 2));
assert_eq!(Duration::new(u64::MAX - 1, 0).saturating_mul(2), Duration::MAX);
```

bevy_utils::Duration::saturating_sub.documentation:
Saturating `Duration` subtraction. Computes `self - other`, returning [`Duration::ZERO`]
if the result would be negative or if overflow occurred.
# Examples
```
use std::time::Duration;
assert_eq!(Duration::new(0, 1).saturating_sub(Duration::new(0, 0)), Duration::new(0, 1));
assert_eq!(Duration::new(0, 0).saturating_sub(Duration::new(0, 1)), Duration::ZERO);
```

bevy_utils::Duration::subsec_micros.documentation:
Returns the fractional part of this `Duration`, in whole microseconds.
This method does **not** return the length of the duration when
represented by microseconds. The returned number always represents a
fractional portion of a second (i.e., it is less than one million).
# Examples
```
use std::time::Duration;
let duration = Duration::from_micros(1_234_567);
assert_eq!(duration.as_secs(), 1);
assert_eq!(duration.subsec_micros(), 234_567);
```

bevy_utils::Duration::subsec_millis.documentation:
Returns the fractional part of this `Duration`, in whole milliseconds.
This method does **not** return the length of the duration when
represented by milliseconds. The returned number always represents a
fractional portion of a second (i.e., it is less than one thousand).
# Examples
```
use std::time::Duration;
let duration = Duration::from_millis(5_432);
assert_eq!(duration.as_secs(), 5);
assert_eq!(duration.subsec_millis(), 432);
```

bevy_utils::Duration::subsec_nanos.documentation:
Returns the fractional part of this `Duration`, in nanoseconds.
This method does **not** return the length of the duration when
represented by nanoseconds. The returned number always represents a
fractional portion of a second (i.e., it is less than one billion).
# Examples
```
use std::time::Duration;
let duration = Duration::from_millis(5_010);
assert_eq!(duration.as_secs(), 5);
assert_eq!(duration.subsec_nanos(), 10_000_000);
```

bevy_utils::Instant::duration_since.documentation:
Returns the amount of time elapsed from another instant to this one,
or zero duration if that instant is later than this one.
# Panics
Previous Rust versions panicked when `earlier` was later than `self`. Currently this
method saturates. Future versions may reintroduce the panic in some circumstances.
See [Monotonicity].
[Monotonicity]: Instant#monotonicity
# Examples
```no_run
use std::time::{Duration, Instant};
use std::thread::sleep;
let now = Instant::now();
sleep(Duration::new(1, 0));
let new_now = Instant::now();
println!("{:?}", new_now.duration_since(now));
println!("{:?}", now.duration_since(new_now)); // 0ns
```

bevy_utils::Instant::elapsed.documentation:
Returns the amount of time elapsed since this instant.
# Panics
Previous Rust versions panicked when the current time was earlier than self. Currently this
method returns a Duration of zero in that case. Future versions may reintroduce the panic.
See [Monotonicity].
[Monotonicity]: Instant#monotonicity
# Examples
```no_run
use std::thread::sleep;
use std::time::{Duration, Instant};
let instant = Instant::now();
let three_secs = Duration::from_secs(3);
sleep(three_secs);
assert!(instant.elapsed() >= three_secs);
```

bevy_utils::Instant::now.documentation:
Returns an instant corresponding to "now".
# Examples
```
use std::time::Instant;
let now = Instant::now();
```

bevy_utils::Instant::saturating_duration.documentation:
Returns the amount of time elapsed from another instant to this one,
or zero duration if that instant is later than this one.
# Examples
```no_run
use std::time::{Duration, Instant};
use std::thread::sleep;
let now = Instant::now();
sleep(Duration::new(1, 0));
let new_now = Instant::now();
println!("{:?}", new_now.saturating_duration_since(now));
println!("{:?}", now.saturating_duration_since(new_now)); // 0ns
```

core::sync::atomic::AtomicBool::into_inn.documentation:
Consumes the atomic and returns the contained value.
This is safe because passing `self` by value guarantees that no other threads are
concurrently accessing the atomic data.
# Examples
```
use std::sync::atomic::AtomicBool;
let some_bool = AtomicBool::new(true);
assert_eq!(some_bool.into_inner(), true);
```

core::sync::atomic::AtomicBool::new.documentation:
